import React from 'react';

const handleInputChange = (event) => {
  setTaskText(event.target.value);
};

function TaskInput({ taskText }) {
  return (
    <div>
      <input
        type="text"
        className="taskInput"
        placeholder="e.g. get a milk"
        value={taskText}
        onChange={handleInputChange}
      />
    </div>
  );
}

export default TaskInput;
